import React from "react";
import "./main.css";

const Gallery_box = (props) => {
  return (
    <div>
      <div className="box">
        <img src={props.img1} alt="" />
        <div className="content">
          <h3>Goa</h3>
          <p>
            The top sightseeing places in Goa are Calangute Beach, Basilica of
            Bom Jesus and more...
          </p>
        </div>
      </div>
    </div>
  );
};

export default Gallery_box;
